import React from "react";

export default function About() {
  return (
    <div
      style={{
        minHeight: "50vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        flexDirection: "column",
        fontFamily: "inherit",
      }}
    >
      <div
        style={{
          background: "#fff",
          borderRadius: 22,
          padding: "40px 60px",
          boxShadow: "0 4px 32px #0001, 0 2px 7px #22d3ee17",
          marginTop: 30,
          textAlign: "center",
        }}
      >
        <div
          style={{
            fontWeight: 700,
            fontSize: 25,
            letterSpacing: 1.2,
            marginBottom: 12,
            color: "#262a43",
          }}
        >
          Welcome to my project!
        </div>
        <div style={{ color: "#575767", fontSize: 17, lineHeight: 1.7 }}>
          This is a modern decentralized property wallet <br /> built with React and Solidity.
        </div>
      </div>
    </div>
  );
}
